import Expenseitem from "./components/Expenseitem";

function App() {
  const thatDay = new Date('27 October 2011 14:48 UTC');
  const values = 500;
  const rate = 300
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenseitem thatDay={thatDay} values={values} rate/>
      <Expenseitem/>
      <Expenseitem/>

    </div>
  );
}

export default App;
